import React from "react";
import PropTypes from "prop-types";
import { Query } from "react-apollo";
import gql from "graphql-tag";
import { perPage } from "../../../config";
const GET_LANDLORD_TENANTS = gql`
  query GET_LANDLORD_TENANTS($skip: Int = 0, $first: Int = 1) {
    getLandlordTenants(skip: $skip, first: $first) {
      id
      firstName
      lastName
      isActive
      sex
      comm_email
      tel_no
      profileImage
      registeredBy {
        id
        userId {
          user_name
        }
      }
      houseId {
        id
        house_no
      }
      stay_duration
      from_date
      street
      updatedAt
    }
  }
`;

const LandlordTenants = (props) => (
  <Query {...props} query={GET_LANDLORD_TENANTS} variables={{ id: props.id }}>
    {(payload) => props.children(payload)}
  </Query>
);

LandlordTenants.propTypes = {
  children: PropTypes.func.isRequired,
};
export default LandlordTenants;
export { GET_LANDLORD_TENANTS };
